#include <iostream>
using namespace std;

string removeDuplicates(string s)
{
    for (int i = 0; i < s.length() - 1; i++)
    {
        if (s[i] == s[i + 1])
        {
            s.erase(i, 2);
            i = -1;
        }

        if (s.length() == 0)
            break;
    }
    return s;
}

int main()
{
    string str = "''";
    cout << removeDuplicates(str)<<endl;

    return 0;
}